import { useEffect, useState } from 'react'
import './main.css'
import CatalogComp from '../ReusableComponents/CatalogComp/CatalogPage'
import Modal from '../ReusableComponents/modalComp/Modal'

export default function Main() {

    const [hide, setChangeHide] = useState("modalContainer1")

    const [showModal] = useState("modalContainer")

    let modalChange = () => {
        if(hide === "modalContainer1"){
            setChangeHide("modalContainer")
        }
    }

    return (
        <div className="catalogContainer relative" id="main">
            <CatalogComp 
            hide={hide} 
            modalChange={modalChange}
            />
            <Modal 
            hide={hide} 
            />
        </div>
    )
}
